function Edit() {
  const {id}=useParams()
  
const navigate=useNavigate()

  const [temname, setname] = useState(localStorage.getItem("name"));
  const [temid, setid] = useState(localStorage.getItem("id"));
  const [Img, setimg] = useState(localStorage.getItem("img"));
  const [About, setabout] = useState(localStorage.getItem("des"));
  const [price, setprice] = useState(localStorage.getItem("price"));
  const [cat, setcat] = useState(localStorage.getItem("cat"));
  const [CATEGORY, setAge] = useState(localStorage.getItem("cat"));
  const handleChange = (event) => {
    setAge(event.target.value);
    setcat(event.target.value);
  } 
  // console.log(temname,Img,About,price,cat)
  return (


    <div>
      
      <div className="makecenterfil">
        <h1>Edit Products</h1>
      </div>
      <div>
        <form className="form">
          <TextField
            id="id"
            type="number"
            defaultValue={temid}
            onChange={(e) => setid(e.target.value)}
            label="No of Product"
            variant="standard"
            sx={{ width: "400px" }}
          />
          <TextField
            id="name"
            // defaultvalue={temname}
            defaultValue={temname}


            onChange={(e) => setname(e.target.value)}
            label="Product Name"
            variant="standard"
            sx={{ width: "400px" }}
          />
          {/* {console.log(temname)} */}
          <TextField
            id="img"
            defaultValue={Img}

            onChange={(e) => setimg(e.target.value)}
            label="Img Src"
            variant="standard"
            sx={{ width: "400px" }}
          />
          {/* {console.log(Img)} */}

          <TextField
            id="about"
            onChange={(e) => setabout(e.target.value)}
            defaultValue={About}

            label="About"
            variant="standard"
            sx={{ width: "400px" }}
          />
          <TextField
            id="price"
            onChange={(e) => setprice(e.target.value)}
            defaultValue={price}

            label="Price"
            variant="standard"
            sx={{ width: "400px" }}
          />

          <Box sx={{ minWidth: 220 }}>
            <FormControl fullWidth>
              <InputLabel id="demo-simple-select-label">
                SELECT CATEGORY
              </InputLabel>
              <Select
                labelId="demo-simple-select-label"
                id="demo-simple-select"
                defaultValue={cat}
                label="CATEGORY"
                onChange={handleChange}
              >
                <MenuItem value={"cam"}>Camera</MenuItem>
                <MenuItem value={"car"}>Car's</MenuItem>
                <MenuItem value={"Ele"}>Electric Products</MenuItem>
                <MenuItem value={"Household"}>Household Products</MenuItem>
              </Select>
            </FormControl>
          </Box>

          <Button
            variant="contained"
            onClick={() => {
              const newproduct = {
                name: temname,
                img: Img,
                des: About,
                id: temid,
                price: price,
                cat: cat,
              };

              fetch(`https://sec-node-hackathon.herokuapp.com/Admin/Edit/${id}`,{
                method:"PUT",body: JSON.stringify(newproduct),headers:{
                  "Content-Type":"application/json"
                }
              })
              navigate("/Admin/EditProduct")
          
            }}
          >
            SUBMIT
          </Button>
        </form>
      </div>
    </div>
    
  );
}

function AddProduct() {
  const navigate = useNavigate();

  const [temname, setname] = useState();
  const [temid, setid] = useState();
  const [Img, setimg] = useState();
  const [About, setabout] = useState();
  const [price, setprice] = useState();
  const [cat, setcat] = useState();
  const [CATEGORY, setAge] = React.useState("");
  const handleChange = (event) => {
    setAge(event.target.value);
    setcat(event.target.value);
  };
  return (
    <div>
      <div className="makecenterfil">
        <h1>Add Products</h1>
      </div>
      <div>
        <div className="form">
          <TextField
            id="id"
            type="number"
            onChange={(e) => setid(e.target.value)}
            label="No of Product"
            variant="standard"
            sx={{ width: "400px" }}
          />
          <TextField
            id="name"
            onChange={(e) => setname(e.target.value)}
            label="Product Name"
            variant="standard"
            sx={{ width: "400px" }}
          />
          {/* {console.log(temname)} */}
          <TextField
            id="img"
            onChange={(e) => setimg(e.target.value)}
            label="Img Src"
            variant="standard"
            sx={{ width: "400px" }}
          />
          {/* {console.log(Img)} */}

          <TextField
            id="about"
            onChange={(e) => setabout(e.target.value)}
            label="About"
            variant="standard"
            sx={{ width: "400px" }}
          />
          <TextField
            id="price"
            onChange={(e) => setprice(e.target.value)}
            label="Price"
            variant="standard"
            sx={{ width: "400px" }}
          />

          <Box sx={{ minWidth: 220 }}>
            <FormControl fullWidth>
              <InputLabel id="demo-simple-select-label">
                SELECT CATEGORY
              </InputLabel>
              <Select
                labelId="demo-simple-select-label"
                id="demo-simple-select"
                value={CATEGORY}
                label="CATEGORY"
                onChange={handleChange}
              >
                <MenuItem value={"cam"}>Camera</MenuItem>
                <MenuItem value={"car"}>Car's</MenuItem>
                <MenuItem value={"Ele"}>Electric Products</MenuItem>
                <MenuItem value={"Household"}>Household Products</MenuItem>
              </Select>
            </FormControl>
          </Box>

         
          <Button
            variant="contained"
            onClick={() => {
              const newproduct = {
                name: temname,
                img: Img,
                des: About,
                id: temid,
                price: price,
                cat: cat,
              };
              console.log(newproduct);

              

              fetch(
                `https://sec-node-hackathon.herokuapp.com/Admin/AddProduct`,
                {
                  method: "POST",
                  body: JSON.stringify(newproduct),
                  headers: {
                    "Content-type": "application/json",
                  },
                }
              ).then(() => {
                navigate("/Admin/EditProduct");
              });
            }}
          >
            SUBMIT
          </Button>
        </div>
      </div>
    </div>
  );
}

function EditProduct() {


  const navigate=useNavigate()


const handleEdit=({id,name,des,price,img})=>{
localStorage.setItem("id",id)
localStorage.setItem("name",name)
localStorage.setItem("des",des)
localStorage.setItem("price",price)
localStorage.setItem("img",img)
}


  const [cam1, secam] = useState([]);


  const handledelete=async(id)=>{
    await fetch("https://sec-node-hackathon.herokuapp.com/Admin/EditProduct/"+id,{method:"DELETE"})
    secam(cam1.filter(data=>data.id !== id))
  }


  const Re = () => {
    useEffect(() => {
      fetch(`https://sec-node-hackathon.herokuapp.com/ALLProduct`)
        .then((data) => data.json())
        .then((e) => secam(e));
    }, []);
  };
  Re();
  console.log(cam1);

  return (
    <div className="campro">
      <div className="makecenter">
        <h2>Edit products</h2>
      </div>

      {cam1.map((e) => {
        return (
          <div className="card">
            <Card sx={{ maxWidth: 345 }}>
              <CardMedia
                component="img"
                height="140"
                image={e.img}
                alt={e.name}
              />
              <CardContent>
                <Typography gutterBottom variant="h5" component="div">
                  {e.name}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  About the product: {e.des}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  Price : {e.price}/<span>hour</span>
                </Typography>
              </CardContent>
              <CardActions>

               <Button  onClick={()=>{
                
                 handleEdit(e)
                  navigate(`/Admin/Edit/${e.id}`)

                
               }}   >Edit</Button>

               
                <Button
                  onClick={() => {
                    
                    handledelete(e.id)
                    secam(cam1.filter(data=>data.id !== e.id))
                    Re()
                   
                  }}
                >
                  Delete
                </Button>
               
              </CardActions>
            </Card>
          </div>
        );
      })}
    </div>
  );
}

